//MANAGE THE COUNTING UP ANIMATION (FOR NUMBERS)
document.addEventListener('DOMContentLoaded', function() {
  const observer = new IntersectionObserver(function(entries) {
    entries.forEach(function(entry) {
      if (entry.isIntersecting) {
        const element = entry.target;
        const fullText = element.textContent.trim();
        const numericPart = fullText.match(/\d+/g); // Capture only the numeric part
        if (numericPart) {
          const startValue = element.hasAttribute('count-down') ? parseInt(element.getAttribute('count-down'), 10) : 0;
          const endValue = parseInt(numericPart[0].replace(/,/g, ''), 10); // Clean any commas for accurate parsing
          const suffix = fullText.replace(/\d+/g, '').trim(); // Capture non-numeric part for suffix
          animateValue(element, startValue, endValue, 1000, suffix);
          observer.unobserve(element); // Stop observing once animation starts
        }
      }
    });
  }, {
    threshold: 0.5
  });
  // Attach the observer to all elements with 'count-up' or 'count-down' attributes
  document.querySelectorAll('[count-up], [count-down]').forEach(function(el) {
    observer.observe(el);
  });
});
function animateValue(obj, start, end, duration, suffix) {
  let startTime = null;
  const direction = start <= end ? 1 : -1;
  const step = function(timestamp) {
    if (!startTime) startTime = timestamp;
    const progress = Math.min((timestamp - startTime) / duration, 1);
    const current = Math.floor(progress * (end - start) + start);
    obj.textContent = current.toLocaleString() + suffix;
    if (progress < 1) {
      requestAnimationFrame(step);
    }
  };
  requestAnimationFrame(step);
}

//MANAGES THE ACCORDIONS
document.addEventListener('DOMContentLoaded', function() {
  const accordionTriggers = document.querySelectorAll('.accordion-trigger');
  accordionTriggers.forEach(trigger => {
    trigger.addEventListener('click', function() {
      const isExpanded = trigger.getAttribute('aria-expanded') === 'true';
      trigger.setAttribute('aria-expanded', !isExpanded);
    });
  });
});

//MANAGES THE EXIT POPUP - ALL PAGES
document.addEventListener('DOMContentLoaded', function() {
  const popupWrapper = document.getElementById('popup-wrapper');
  const leavePageBtn = document.getElementById('leave-page');
  const cancelBtn = document.getElementById('cancel');
  const closePopupBtn = document.getElementById('close-popup');
  const popupHeading = document.getElementById('popup-heading');
  let externalLink = '';
  let lastFocusedElement = null;
  const internalExceptions = [
    'https://policy.cookiereports.com/2d856d17-en-gb.html',
    'https://trust.evinova.com/',
    // add more here as needed
  ];
  function isExternalLink(link) {
    const url = new URL(link.href, window.location.origin);
    const isDifferentHost = url.hostname !== window.location.hostname;
    const isException = internalExceptions.some(exception =>
      exception.startsWith('/') ?
      url.pathname === exception :
      link.href.startsWith(exception)
    );
    return isDifferentHost && !isException;
  }
  document.body.addEventListener('click', function(e) {
    const link = e.target.closest('a');
    if (!link) return;
    if (isExternalLink(link)) {
      e.preventDefault();
      externalLink = link.href;
      lastFocusedElement = document.activeElement;
      popupWrapper.style.display = 'flex';
      popupHeading.focus();
      trapFocus();
    }
  });
  // LEAVE â manually close + redirect
  leavePageBtn.addEventListener('click', function() {
    // 1. close modal
    releaseFocus();
    popupWrapper.style.display = 'none';
    // 2. redirect
    window.location.href = externalLink;
  });
  // CANCEL / CLOSE â use hidePopup()
  cancelBtn.addEventListener('click', hidePopup);
  closePopupBtn.addEventListener('click', hidePopup);
  function hidePopup() {
    popupWrapper.style.display = 'none';
    releaseFocus();
    if (lastFocusedElement) lastFocusedElement.focus();
    externalLink = '';
  }
  const focusableSelectors = [
    'a[href]', 'area[href]',
    'input:not([disabled])', 'select:not([disabled])',
    'textarea:not([disabled])', 'button:not([disabled])',
    '[tabindex]:not([tabindex="-1"])', '[contenteditable]'
  ].join(',');
  let firstFocusable, lastFocusable;
  function trapFocus() {
    const nodes = Array.from(popupWrapper.querySelectorAll(focusableSelectors))
      .filter(el => el.offsetWidth || el.offsetHeight || el === document.activeElement);
    firstFocusable = nodes[0];
    lastFocusable = nodes[nodes.length - 1];
    document.addEventListener('keydown', onKeyDown);
  }
  function onKeyDown(e) {
    if (e.key === 'Tab') {
      if (e.shiftKey) {
        if (document.activeElement === firstFocusable) {
          e.preventDefault();
          lastFocusable.focus();
        }
      } else {
        if (document.activeElement === lastFocusable) {
          e.preventDefault();
          firstFocusable.focus();
        }
      }
    } else if (e.key === 'Escape') {
      hidePopup();
    }
  }
  function releaseFocus() {
    document.removeEventListener('keydown', onKeyDown);
  }
});
